post_text:
Good Afternoon Everyone;

As you know, on May 1st, 2020; Governor Cuomo announced an extension to the statewide school closure. Schools across the state will now be closed for the remainder of the school year. During this time schools will continue to provide remote instruction. This announcement required a change to the student academic calendar. The last day for students is now scheduled for June 15th, 2020. Collection of school provided technology and textbooks will take place on June 15th. Details of the collection process will be provided in a future communication. Continue to monitor the district website and social media as these sources provide the most up-to-date information. As always, if you need further support or have questions, please do not hesitate to contact the district office at 315-845-6800. Please stay safe, and whenever possible stay home.

Mr. Shepardson - Superintendent

