post_text:
Good Afternoon Everyone;

On May 1st, 2020; Governor Cuomo announced an extension to the statewide school closure. Schools across the state will now be closed for the remainder of the school year. During this time schools will continue to provide remote instruction, food service, and child care options for essential personnel. The district will be providing further information on this closure extension and what this means for the West Canada Valley School Community next week. This is a very difficult time for our entire community and there will be many questions with today's announcement. Please know we will work together in the upcoming weeks to address all questions and concerns. Continue to monitor the district website and social media as these sources provide the most up-to-date information. As always, if you need further support or have questions, please do not hesitate to contact the district office at 315-845-6800. Please stay safe, and whenever possible stay home.

Mr. Shepardson - Superintendent

